import Navbar from '../Navbar/Navbar';
import './Home.css';
import PreviewMainfo from '../PreviewMaininfo/PreviewMaininfo';
import Infoshow from '../Infoshow/Infoshow';
import Bottonfocus from '../Bootonfocus/Bottonfocus';

function Home() {
  return (
    <div className="homepart">
      <Navbar />
      <h1>Bienvenid@</h1>
      <PreviewMainfo 
        imageSrc='./../images/imagescontent/almuerzopic.webp'
        text="Noticias"
      />
      <Infoshow />
      <Bottonfocus />
      <Bottonfocus />
    </div>
  );
}

export default Home ;
